Introduction to AutoCAD 2011 by Alf Yarwood.

Alf Yarwoods best-selling text provides a comprehensive, step-by-step introduction to the latest release of AutoCAD. It covers all the requirements of City and Guilds courses in Computer Aided Design, Computer Aided Engineering and the drawing modules in BTEC Higher and National Higher Engineering.

After beginning with the basic principles and an introduction to 2D technical drawing, he continues with extensive coverage of all 3D topics such as 3D solid modelling and rendering, taking into account all the new features of the 2011 AutoCAD software. The full-colour, clear presentation makes this the best choice for all beginning students of AutoCAD.

